PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT 
    ?g (SAMPLE(?gLabel) AS ?gLabel) 
    (COUNT(?g) as ?count) 


WHERE {

        VALUES ?p { <http://www.wikidata.org/prop/direct/P102> } 
        ?s ?p ?o



        VALUES ?p0 { <http://www.wikidata.org/prop/direct/P27> }
        VALUES ?o0 { <http://www.wikidata.org/entity/Q30> }
        ?s ?p0 ?o0



        VALUES ?p1 { <http://www.wikidata.org/prop/direct/P106> }
        VALUES ?o1 { <http://www.wikidata.org/entity/Q82955> }
        ?s ?p1 ?o1



        BIND (?o as ?g)
        OPTIONAL { ?g rdfs:label ?gLabel filter (lang(?gLabel) = "en"). }

}
GROUP BY
    (?g)
HAVING ( COUNT(?g) >= 1 )
ORDER BY desc(?count)
LIMIT 20

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT 
    (SAMPLE(?s) AS ?s) (SAMPLE(?sLabel) AS ?sLabel) 
    (SAMPLE(?p) AS ?p) (SAMPLE(?pLabel) AS ?pLabel) 
    ?o (SAMPLE(?oLabel) AS ?oLabel) 


WHERE {

        VALUES ?p { <http://www.wikidata.org/prop/direct/P102> } 
        ?s ?p ?o



    OPTIONAL { ?s rdfs:label ?sLabel filter (lang(?sLabel) = "en"). }
    OPTIONAL { ?p rdfs:label ?pLabel filter (lang(?pLabel) = "en"). }
    OPTIONAL { ?o rdfs:label ?oLabel filter (lang(?oLabel) = "en"). }



        VALUES ?p0 { <http://www.wikidata.org/prop/direct/P27> }
        VALUES ?o0 { <http://www.wikidata.org/entity/Q30> }
        ?s ?p0 ?o0



        VALUES ?p1 { <http://www.wikidata.org/prop/direct/P106> }
        VALUES ?o1 { <http://www.wikidata.org/entity/Q82955> }
        ?s ?p1 ?o1

}
GROUP BY
    (?o)


LIMIT 100

SELECT *

WHERE {

    { SELECT (COUNT(?s) AS ?complete_count)

WHERE {

        VALUES ?p { <http://www.wikidata.org/prop/direct/P102> } 
        ?s ?p ?o



        VALUES ?p0 { <http://www.wikidata.org/prop/direct/P27> }
        VALUES ?o0 { <http://www.wikidata.org/entity/Q30> }
        ?s ?p0 ?o0



        VALUES ?p1 { <http://www.wikidata.org/prop/direct/P106> }
        VALUES ?o1 { <http://www.wikidata.org/entity/Q82955> }
        ?s ?p1 ?o1

}



 }
    { SELECT (COUNT(?s) AS ?missing_count)

WHERE {

        FILTER NOT EXISTS {
          VALUES ?p { <http://www.wikidata.org/prop/direct/P102> } 
          ?s ?p ?o
        }



        VALUES ?p0 { <http://www.wikidata.org/prop/direct/P27> }
        VALUES ?o0 { <http://www.wikidata.org/entity/Q30> }
        ?s ?p0 ?o0



        VALUES ?p1 { <http://www.wikidata.org/prop/direct/P106> }
        VALUES ?o1 { <http://www.wikidata.org/entity/Q82955> }
        ?s ?p1 ?o1

}



 }

}



LIMIT 20

