PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?p
?pLabel
?o
?oLabel

WHERE {
VALUES ?tmp0 { <http://www.wikidata.org/entity/Q937> }.
?tmp0 ?p ?o .
FILTER(!isLiteral(?o) || langMatches(lang(?o), "en") || langMatches(lang(?o), ""))
OPTIONAL { { ?pClaim <http://wikiba.se/ontology#directClaim> ?p .
?pClaim rdfs:label ?pLabel . } 
UNION
 { ?p rdfs:label ?pLabel . }
FILTER (BOUND(?pLabel) && lang(?pLabel) = "en"). }
OPTIONAL { ?o rdfs:label ?oLabel .
FILTER (BOUND(?oLabel) && lang(?oLabel) = "en"). }
?pClaim <http://wikiba.se/ontology#directClaim> ?p .
}



LIMIT 401

