 VALUES ?tmp1 { <http://www.wikidata.org/prop/direct/P106> }. 
 VALUES ?tmp2 { <http://www.wikidata.org/entity/Q169470> }. 
 ?main ?tmp1 ?tmp2 .
      OPTIONAL { { ?mainClaim <http://wikiba.se/ontology#directClaim> ?main .
?mainClaim rdfs:label ?mainLabel . } 
UNION
 { ?main rdfs:label ?mainLabel . }
FILTER (BOUND(?mainLabel) && lang(?mainLabel) = "en"). }

}



